const MovieDetails = ({ movie }) => {
  return (
    <div>
        {showDetails && (
        <div className="modal">
          <SerieDetails movie={movie} />
          <button className="modal-button" onClick={() => setShowDetails(false)}>
            Volver
          </button>
        </div>
      )}
    </div>
  );
};



export default MovieDetails;
